import React from 'react';

function Contact() {
  return (
    <section className="max-w-4xl mx-auto p-8">
      <h2 className="text-3xl font-bold mb-4">Contact Me</h2>
      <p className="mb-2">Email: ayush@example.com</p>
      <p>LinkedIn: <a href="https://linkedin.com/in/your-profile" target="_blank" rel="noreferrer" className="text-blue-600 hover:underline">your-profile</a></p>
    </section>
  );
}

export default Contact;
